  return (
    <header className={styles.header}>
      <div className={styles.container}>
        <div>
          <h1>MyTodo</h1>

          <span>Bem vindo, Luiz Marcelo!</span>
        </div>

        <div>
          <StatsCard title="Total de tarefas" value={5}/>
          <StatsCard title="Tarefas Pendentes" value={4}/>
          <StatsCard />
        </div>
      </div>
    </header>
  );
};
